import { Fragment } from 'react';
import {Reset} from 'styled-reset';

import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';


function App() {
  return (
    <Fragment>
      <Reset />
      <Header />
      <Footer />
    </Fragment>
  );
}

export default App;
